public boolean equals(Object obj) {
  if (this == obj) {
    return true;
  }
  if (obj == null) {
    return false;
  }
  if (getClass() != obj.getClass()) {
    return false;
  }
  SubClusterId other = (SubClusterId) obj;
  return this.getId().equals(other.getId());
}
